import NavBars from './components/NavBars';


const Index = () => (
    
<div className="wrapper">

<NavBars />

<div>
  <img className="bodyy" src="http://drive.google.com/uc?export=view&id=1XZhPmy4AWCI5k8O0oOdFSU266HD_AsEY"/>
</div>
  
  
<footer>
    <img className="icons" src="http://drive.google.com/uc?export=view&id=1KhAw49qHfone5e3m0Ttsi_8M__Eysx5z"/>
</footer>
  



<style jsx>{`
        p{   
          font-family: 'Barlow', sans-serif;
          
        }
        div{
            text-align: center;
        }
        .bodyy{
            height: 500px;
            position: absolute;
            top: 12%;
            left: 30%;
        }
        .icons{
          height:45px;
        }
        footer{
          display:block;
          position: absolute;
          bottom: 3%;
          right: 39%;
        }

        @media only screen and (max-width:500px){
          .bodyy{
            height: 350px;
            position: absolute;
            top: 25%;
            left: 5%;
          }
        }

  
        

       
      `}</style>
</div>

  );
  
  export default Index;
